import React from 'react'

function ChartComponent({ ts, status, value }) {
    return (
        <>
            <div className="row">
                <div className='col'>{ts}</div>
                <div>{status}</div>
                <div>{value}</div>
            </div>
        </>
    )
}

export default ChartComponent
